require("dotenv").config();
const { promisify } = require("util");
const fs = require('fs')
const amqp = require("amqplib/callback_api");
const client = require("redis").createClient({
  host: process.env.REDIS_HOST,
  password: process.env.REDIS_PASSWORD,
  port: process.env.REDIS_PORT,
});
const set = promisify(client.set).bind(client);
const { Pool } = require("pg");

const pool = new Pool({
  user: process.env.PG_USER,
  host: process.env.PG_HOST,
  database: process.env.PG_DATABASE,
  password: process.env.PG_PASSWORD,
  port: process.env.PG_PORT,
});

const image = ""

const q = "avatar_tasks";
const amqp_url = process.env.AMQP_URL;

function bail(err) {
  console.error(err);
  process.exit(1);
}

const on_open = async (err, ch) => {
  if (err != null) bail(err);
  for (let i = 0; i < 20; i++) {
    const dbRes = await insertUser(i)
    const id = dbRes.rows[0].id
    await set(`user_${id}_avatar`, image);
    ch.assertQueue(q);
    ch.sendToQueue(q, Buffer.from(`${id}`));
  }
  process.exit()
};
// Publisher
const publisher = async (conn) => {
  await conn.createChannel(on_open);
};

amqp.connect(amqp_url, async (err, conn) => {
  if (err != null) bail(err);
  await publisher(conn);
});


const insertUser = (i) => {
  return new Promise((resolve, reject) => {
      const query = 'INSERT INTO "user" (username, password, email) VALUES ($1, $2, $3) RETURNING id'
      const values = [`username_${i}`, `password_${i}`, `email${i}`]
  
      pool.query(query, values, (err, res) => {
          if (err) reject(err)
          resolve(res)
      })
  })
}